import React from 'react';

const keyboard = () => (
	<table>
		<tr>
			<th>1</th>
			<th>2</th>
			<th>3</th>
		</tr>
		<tr>
			<th>4</th>
			<th>5</th>
			<th>6</th>
		</tr>
	</table>
);

export default keyboard;
